import React from 'react';
import ReactDOM from 'react-dom';
import 'mapbox-gl/dist/mapbox-gl.css';
import './index.css';
import Map from './components/Map';
import TrashData from './components/TrashData'; // import the component


ReactDOM.render(
  <React.StrictMode>
    <Map />
    <TrashData /> {/* display the component */}
  </React.StrictMode>,
  document.getElementById('root')
);
